import React from 'react';
import '../App.css';
import IconButton from '@mui/material/IconButton';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import LoginIcon from '@mui/icons-material/Login';
import Button from '@mui/material/Button';
import MenuIcon from '@mui/icons-material/Menu';
import { useNavigate } from 'react-router-dom'

const Header: React.FC = () => {
  const navigate = useNavigate();

  const goHome = () => {
    navigate('/')
  };

  const goCompany = () => {
    navigate('/company')
  };
  const goMylist = () => {
    navigate('/board_mylist')
  };
  const goPredict = () => {
    navigate('/board_predict')
  };

  return (
      <header className="App-header">
          <div className='App-header-menu-icon'>
            <IconButton size="large" onClick={() => { goHome() }}>
              <MenuIcon fontSize="inherit"/>
            </IconButton>
          </div>
          <nav className='App-header-nav'>
            <ul>
              <li>
              <Button variant="text" size="large" onClick={() => { goCompany() }}>기업</Button>
              </li>
              <li>
              <Button variant="text" size="large" onClick={() => { goMylist() }}>이력서</Button>
              </li>
              <li>
              <Button variant="text" size="large" onClick={() => { goPredict() }}>합격예측</Button>
              </li>
            </ul>
          </nav>
          <div className='App-header-profile-icons'>
            <IconButton size="large">
              <PersonAddIcon fontSize="inherit"/>
            </IconButton>
            <IconButton size="large">
              <LoginIcon fontSize="inherit"/>
            </IconButton>
          </div>
        <hr className='App-header-underline'/>
      </header>
  );
}

export default Header;
